const defaultState = {
    state: true,
  }

export  const Burger = (state = defaultState, action) => {
    switch(action.type){
      case "ACTIVE":
        return {...state, count: true}
      case "OFF":
        return {...state, count: false}
      default:
        return state;
    }
  }
